import React, { Fragment } from "react";
import { 
    BrowserRouter as Router, 
    Routes,
    Route, 
    Navigate
  } from "react-router-dom";
import MenuCategories from "./MenuCategories";
import DrinkMenu from "./DrinkMenu";

const Menu = () => {
    return (
        <Fragment>
            <Router>
                <div className="container">
                    <Routes>
                        <Route path="/menu/drinks/:drinkType" element={<DrinkMenu />}/>
                    </Routes>
                </div>
            </Router>
            <h1>Menu</h1>
            <MenuCategories />
        </Fragment>
    );
}

export default Menu;
